(152, 'Johanna ', 3, 'Ensimmäisellä kerralla tuli itselleni keskeytys ja olisin halunnut tallentaa vastaukset. ', '2017-04-04 18:11:32'),
(86, 'susanna.kytovaara@netikka.fi', 2, 'Siitä että vastausten perusteella ei lokeroitu vastaajaa mitenkään. Materiaali sopii kaikille mietittäväksi ja pohdittavaksi. Ei oikeita tai vääriä vastauksia, vaan itsetuntemusta.', '2017-04-02 16:18:17'),
(87, 'susanna.kytovaara@netikka.fi', 3, 'Visuaalisena ihmisenä toivoisin kuvia, värejä.', '2017-04-02 16:19:28'),
(88, 'susanna.kytovaara@netikka.fi', 4, 'Puhelin on henkilökohtainen, yleensä aina mukana, joten materiaaliin mahdollista syventyä rauhassa missä vain. ', '2017-04-02 16:21:20'),
(89, 'karonen.anne@gmail.com', 1, 'Kiinnostus itseä kohtaan heräsi ja sain peilauspintaa ihmisenä olemisessa. Löysin väylän eteenpäin. ', '2017-04-02 16:29:08'),
(90, 'karonen.anne@gmail.com', 2, 'Ajatusten herättelystä. ', '2017-04-02 16:29:32'),
(91, 'karonen.anne@gmail.com', 3, '', '2017-04-02 16:30:00'),
(92, 'karonen.anne@gmail.com', 4, 'Hyvin. Helppokäyttöisyys ja vaivattomuus tutkia sisäisyyttä taskupeilin lailla.', '2017-04-02 16:31:25'),
(93, 'terhi.kivikoski@gmail.com', 1, 'Sovellus oli hyvin helppokäyttöinen. Tekstiosuudet olivat  kovin pitkät lukea, tuli hypittyä joidenkin rivien yli. Mutta käyttökokemus oli hyvä!', '2017-04-02 17:02:39'),
