(96, 'terhi.kivikoski@gmail.com', 4, 'Hyvin', '2017-04-02 17:04:02'),
(97, 'tapio.karonen@gmail.com', 1, 'Mielenkiintoinen ja jokaisen kansalaisajokorttiin vaaditta suoritus', '2017-04-02 18:17:29'),
(98, 'tapio.karonen@gmail.com', 2, 'Herätti kysymyksiä itsestäni.', '2017-04-02 18:17:59'),
(99, 'tapio.karonen@gmail.com', 3, '', '2017-04-02 18:18:00'),
(100, 'tapio.karonen@gmail.com', 4, 'Pitäisi saada joka kerta yksi kysymys näkyviin kun avaa puhelimen eli ei ennen vastausta avaudu.', '2017-04-02 18:21:16'),
(101, 'Virpi-Marja', 1, 'Pidin kysymysvaihtoehdoista. Ne olivat hyviä ja mielenkiintoisia. Vastausselitykset olivat osin liian pitkiä ja teoreettisia enkä heti hahmottanut että niissä oli kyse antamieni vastausten perusteella tehdystä tulkinnasta tai käytännössähän itse valitsin sen mikä minulle sopii parhaiten. Jotkut selitykset olivat hyvin avaavia ja antoivat uutta informaatiota itsestäni.', '2017-04-02 20:18:13'),
(102, 'Virpi-Marja', 2, 'Eniten pidin vastata kysymyksiin.', '2017-04-02 20:18:40'),
(103, 'Virpi-Marja', 3, 'Pitkistä teoreettisista teksteistä, etenkin alussa selostus tuntui liian pitkältä.', '2017-04-02 20:19:14'),
(104, 'Virpi-Marja', 4, 'Hyvin soveltuu ja tässä on antia eri tavalla kuin peleissä tms. Minä tosin kirjoittelen tässä tietokoneellani. Mobiilissa olisi vaikeampaa kirjoittaa ja lukea pitkiä tekstejä.', '2017-04-02 20:21:33'),
(105, 'Helmi', 1, 'Alkuteksti herätteli hyvin kysymyksiin, tuli tunne selkeydestä ja siitä, että kaikki vastaukset ja vastausnopeudet ovat hyväksyttyjä. Osaan kysymyksistä vastasin nopeasti. Selvästi ne kohat, jossa itsellä on vielä kehityttävää, veivät vastata myös pidempään. Kovinkin tärkeäksi olla rohkea ja rehellinen erityisesti niissä kohdin. Vastaukset toimivat hyvänä peilinä, johon kysymyksistä heränneet ajatukset ja tunteet pystyi heijastamaan. Toisaalta en kokenut suurta ristiriitaa tekstiin ja varmasti myös tästä syystä kokemus olikin miellyttävä ja enemmänkin positiivisella tavalla kertaava sekä motivoiva. Itse sovellus toimi odotetusti muuten, paitsi yhden kysymyksen kohdalla se siirtyi kerran seuraavan sijaan edelliseen. Ohjelma oli selkeä, siinä oli helppo pysyä kärryillä ja sai keskittyä itse asiaan, eli itsetutkiskeluun. Sellaista toivoisin, että omat vastaukset ja tulokset saisi halutessaan esim. sähköpostiin. Olisi hyödyllistä ja mieluisaa palata kysymyksiin myöhemminkin. Näin sovelluksen itsetuntemusta lisäävä vaikutuskin luultavasti paranisi. Tämä sovellus on hyödyllinen ja poikkeava mobiilitoimintaympäristössään.', '2017-04-02 20:38:58'),
(106, 'Helmi', 2, 'Sen motivoivasta, valtaistavasta ja itsetuntemusta vahvistavasta otteesta. Se lähtee liikkeelle ihmisen omasta kokemuksesta omasta elämästään. Onkin hyvä, että seuraavassa vaiheessa käyttäjä saa ymmärtääkseni lisää myös käytännön vinkkejä ja harjoitteita, joilla näitä alkuvaiheen oivalluksia voi kehittää.', '2017-04-02 20:47:44'),
(107, 'Helmi', 3, 'Toivon, että vastaukset saisi tosiaan tulevaisuuden työskentelyäkin ajatellen jotenkin talteen. ', '2017-04-02 20:49:26'),
(108, 'Helmi', 4, 'Hyvin. Puhelin on hyvin arkinen laite monelle. Ohjelma ei siis vaadi paljoa käyttäjältään ja toisaalta testin voi tehdä silloin kun kokee, että nyt on hyvä hetki. Toisaalta sen takia on tärkeää myös ohjeistaa, että tekijä valitsee juuri riittävästi aikaa ja ympäristön, jossa voi syventyä. Hieno asia, että puhelimessa voi olla sisällöllisesti myös tällaisia ohjelmia.', '2017-04-02 20:54:52'),
(109, 'HelHe', 1, 'Kiireinen arki on saanut minut etääntymään itsetutkiskelusta. Tämä oli hyvä motivaattori ja kadonneen innostuksen löytäjä. \r\nKysely herätti paljon ajatuksia ja muistutti minua siitä minne päin haluan elämässäni mennä.\r\nLopun analyysit olivat hyviä ja jokaisesta aihealueesta löysin paljon ajateltavaa. ', '2017-04-03 10:02:06'),
(110, 'HelHe', 2, 'Helppo käyttöinen eikä vienyt paljon aikaa, kun vastasi hyvin intuitiolla.\r\n', '2017-04-03 10:03:54'),
(111, 'HelHe', 3, 'Omat vastaukset olisivat voineet näkyä heti, eikä klikkauksen takaa.', '2017-04-03 10:04:48'),
(112, 'HelHe', 4, 'Hyvin', '2017-04-03 10:05:00'),
(113, 'Toi1', 1, 'Yhteys katkesi pari kertaa, aloitettava alusta. Siirtyi muuten nopeastl seuraavaan kohtaan. Tekstiosat pitkiä. ', '2017-04-03 15:49:41'),
(114, 'Toi1', 2, 'Nopea siirtyminen kysymyksestä toiseen', '2017-04-03 15:50:22'),
(115, 'Toi1', 3, 'Uudelleen täyttäminen', '2017-04-03 15:50:45'),
(116, 'Toi1', 4, 'Hyvä idea.\r\nVaikka tekstiosa tuntui pitkältä "nälkä kasvaa syödessä", liitteeksi vaikkapa "linkkiviidakko" aiheesta. ', '2017-04-03 15:56:00'),
(117, 'marja-liisa', 1, '', '2017-04-03 16:24:09'),
