(119, 'marja-liisa', 3, '', '2017-04-03 16:24:17'),
(120, 'marja-liisa', 4, '', '2017-04-03 16:24:27'),
(121, 'Anitta', 1, 'Erilainen sovellus,joka peilaa ihmiseen itseensä. Uskon,että ajan myötä ulkoasu muuttuu erilaiseksi. ', '2017-04-03 17:35:10'),
(122, 'Anitta', 2, 'Testejä on aina mukava tehdä. Tuloksia lukiessa huomaa taas mihin tarvitsee kiinnittää huomiota.', '2017-04-03 17:36:00'),
(123, 'Anitta', 3, 'Alussa oli pitkä ja hyvä pohjustus,mutta näin iltasella oli hankala keskittyä siihen.', '2017-04-03 17:37:39'),
(124, 'Anitta', 4, 'Hyvin soveltuu ja voi tuoda sitä lähemmäksi ihmisille,jotka eivät ehkä vielä ole asiaan perehtyneet juurikaan.', '2017-04-03 17:38:35'),
(125, 'Mirjaelina@gmail.com', 1, 'Nopea ja selkeä', '2017-04-03 17:53:21'),
(126, 'Mirjaelina@gmail.com', 1, 'Nopea ja selkeä', '2017-04-03 17:53:22'),
