(130, 'anne.alhava@tukena.fi', 1, 'Helppo, nopea ja johdonmukainen. ', '2017-04-03 18:19:39'),
(131, 'anne.alhava@tukena.fi', 2, 'Gelppokäyttöisyydestä ja ajatusten herättelystä', '2017-04-03 18:20:27'),
