(134, 'arjakuur@dnainternet.net', 1, 'Helppokäyttöinen. Ehkä vähän liikaa tekstiä minulle. Olin ehkä vähän väsynyt tehdessäni testiä. ', '2017-04-03 18:36:16'),
(135, 'arjakuur@dnainternet.net', 2, 'Mukavia minäkuvan kehitysharjoituksia', '2017-04-03 18:37:08'),
(136, 'arjakuur@dnainternet.net', 3, 'Liikaa tekstiä', '2017-04-03 18:37:22'),
