(138, 'Janina', 1, '', '2017-04-03 18:52:33'),
(139, 'Janina', 2, '', '2017-04-03 18:52:34'),
(140, 'Janina', 3, '', '2017-04-03 18:52:36'),
(141, 'Janina', 4, 'Hyvin', '2017-04-03 18:52:43'),
(142, 'Helmi', 1, 'Alkuohjeistus opasti hyvin sovelluksen käyttöön. Se myös herätteli hyvin vastaanottamaan myös haasteellisia kysymyksiä sekä pohtimaan asioita. Itse kyselyvaiheessa juuri ne asiat, missä koen kehittämisenvaraa, veivät pisimpään vastata. Oli tärkeää olla rehellinen itselle ja vastata rohkeasti. Kysymykset herättelivätkin pohtimaan omaa elämää ja sen pohjalla olevia kokemuksia, tunteita ja arvoja. Sinänsä kysymykset ovat riittävän laajoja, että ne soveltuvat hyvin erilaistenkin ihmisten ja elämäntilanteiden pohdintaan. Palautetekstit antoivat tähän pohdintaan hyvän peilin, joihin omia ajatuksia saattoi verrata. Toisaalta itselleni kokemus oli alkujaan helppo, koska en kokenut suuria ristiriitaisuuksia tekstin tai sovelluksen kanssa. \r\n\r\nItse sovellus toimi hyvin, tosin kerran se laittoi minut seuraavan kohdan sijaan edelliseen. Tein myös testin kaksi kertaa, koska viimeisessä kohdassa yritin päästä alkutekstiin ja jouduinkin ohjelmasta pois, eikä vastaukseni ollut tallentunut. Toisen kerran kysymykset olivat tuttuj ja näin pääsin syventymään niihin vieläkin enemmän. \r\n\r\nToivoisin, että myös omat vastaukset saisi sähköpostiin. Se voisi toimia myöhemmässä vaiheessa hyvänä pohjana esim. oman kehityksen havainnoimisessa.', '2017-04-03 18:55:49'),
(143, 'Helmi', 2, 'Sen tukea-antavasta, valtaistavasta ja motivoivasta pohjavireestä. On tärkeää, että ihminen saa itse näin arvioida omaa sisäistä maailmaansa. ', '2017-04-03 18:57:22'),
(144, 'Helmi', 3, 'Minua harmittaa tosiaan se, että itse kysymykset ja omat vastaukseni jäävät ymmärtääkseni unholaan, koska niihin olisi kiva palata myöhäisemmässä vaiheessa.', '2017-04-03 18:58:45'),
(145, 'Helmi', 4, 'Puhelin toimii arkipäiväisyytensä takia hyvin tässä. Se ei samalla tavalla sido paikkaan kuin esim. tietokone. Toisaalta tämä voi asettaa myös haasteen, jos sovellusta alkaa käyttämään täysin vääränlaisena hetkenä. Sinänsä on ihanaa, että kännykällä "pääsee käsiksi" myös tällaisiin itsetuntemusta lisäävien ja hetkeen ja itseen syvennyttäviin sovelluksiin.', '2017-04-03 19:03:10'),
(146, 'Jpiikki', 1, 'Pääosin ihan ok. Jotkn väittämistä eivät auenneet tarkoituksensa osalta (es. 13, 15, 32) mikä hämmensi kokonaisymmärrystä. Tekstit ovat tosi pitkiä ja visuaalisesti "tylsiä", jotkut kuvat tai luettelojen käyttö auttaisi hahmottamaan ja jaksamaan paremmin.', '2017-04-04 16:43:48'),
(147, 'Jpiikki', 2, 'Simppeli kokonaisuus.', '2017-04-04 16:44:18'),
(148, 'Jpiikki', 3, 'Ks edelliset kaksi vastausta', '2017-04-04 16:44:44'),
(149, 'Jpiikki', 4, 'Ihan hyvin jos ja kun on mobiililaite-ihminen. Itse en tykkää kännykän pienestä näytöstä vaan katselen mieluummin kannettavan ruudulta.', '2017-04-04 16:46:34'),
(150, 'Johanna ', 1, 'Sinfonia, mielenkiintoisesti kasvavalla tempolla edeten. Taiteellinen kokemus jollakin tasolla. Teknisesti ei liian haastava. ', '2017-04-04 18:09:21'),
(151, 'Johanna ', 2, 'Ajatuksia herättelevä, ei päästänyt liian helpolla. ', '2017-04-04 18:10:18'),
(13, 'karoliinahallenberg@hotmail.com ', 1, 'Pidin todella paljon sovelluksen sisällöstä, sekä käyttökokemuksesta. Sovellus nosti esiin varsin älykkäällä tavalla elämän keskeisimmät teemat. Sovelluksen avulla ihminen pääsee peilaamaan teemoja omaan itseen, mikä nostaa arvoa valtavasti. Muutoin kokemus saattaisi jäädä vain luetun tiedon ulkokohtaiseksi käsittelyksi. Tässä itsearviointi laittaa ihmisen peruskysymysten äärelle, mutta tekee sen pehmeästi, ei ylhäältä käsin määrittävällä tavalla. Uskon, että tämän tyylisellä lähestymisellä ihminen voi kyetä nostamaan näkyväksi ja muokattavaksi henkilökohtaisia haasteita, sekä omaan ja ympäröivään maailmaan  liittyviä kehityskysymyksiä. Koin, että tämän tyyppinen tarkastelu tukee ennen kaikkea omaa ja sitä kautta laajempaa hyvinvointia. \r\nLämmin Kiitos! ', '2017-04-01 12:58:09'),
(14, 'karoliinahallenberg@hotmail.com ', 2, 'Pidin eniten sovelluksen sisällöstä ja tavasta tuoda kysymykset tarkasteluun oman itsen kautta. ', '2017-04-01 12:59:03'),
(15, 'karoliinahallenberg@hotmail.com ', 3, 'Kokemus oli kaikin puolin miellyttävä. ', '2017-04-01 12:59:28'),
