(85, 'susanna.kytovaara@netikka.fi', 1, 'Mielenkiintoinen matka itseen ja itsetuntemukseen. Hyvä ja kiinnostava alku uudenlaiselle sovellukselle. Odotan erilaisia keinoja vahvistaa itsetuntemusta, keinoja rikkoa omia pinttyneitä kaavoja ja esimerkkejä vahvistaa omia vahvuuksia. Sovellus on mainio mahdollisuus kehittää ajatusmaailmaansa ja voimaantua.', '2017-04-02 16:15:03'),
(25, 'Katja', 1, 'Tekstiosioista oli vaikea äkkiseltään ymmärtää, mihin ne liittyivät. Luulin sovelluksen antavan palautteen minulle minun vastauksista, mutta hämmennyin, kun palaute olikin teoriaa kyseisestä aiheesta. Kerrontatapa ei koskettanut, vaan jäi kovin etäiseksi. Tuli myös kokemus, että minua opetetaan ylhäältä päin. Liian pitkät tekstit eivät sopineet tähän yhteyteen, kun testin tekemiseen liittyy omassa mielessäni tietynlainen helppous, enkä ollut orientoitunut "opiskelemaan" asiaa tässä yhteydessä. Olisin kaivannut itseä koskettavaa motivointia. Ja selkeämmin alkuun esille hyödyt ja pää pointit. \r\nKysymysten kohdalla häiritsi se olettamus, että 7 olisi paras vastaus, 1 huonoin. Lisää kokemusta siitä, että minua arvioidaan. Kuitenkaan yhteenvedossa, missä vastaukseni keskiarvot kerrottiin, sen tuomaa informaatiota ei avattu mitenkään. ', '2017-04-01 15:43:53'),
(26, 'Katja', 2, 'Kysymykset oli helppo ymmärtää ', '2017-04-01 15:44:13'),
